//-------------------------------------------------------------------------------
//
// ABSTRACT: Fixed-point exponential base-2 (DW_exp2) - exp2(a) = 2^a
//           Computes the value of 2 to the power a, where a is a fixed point 
//           value in the range [0,1) delivering a result that is always
//           normalized -> range [1,2).
//           The number of fractional bits to be used is controlled by
//           a parameter. 
//
//              parameters      valid values (defined in the DW manual)
//              ==========      ============
//              op_width        operand size,  >= 2 and <= 60
//                              number of fractional bits at the input
//              arch            implementation select
//                              0 - area optimized 
//                              1 - speed optimized
//                              2 - 2007.12 implementation (default)
//              err_range       error range of the result compared to the
//                              true result. Default is used when arch=2.
//                              1 - 1 ulp max error (default)
//                              2 - 2 ulp max error
//
//              Input ports     Size & Description
//              ===========     ==================
//              a               main input with op_width fractional bits
//
//              Output ports    Size & Description
//              ===========     ==================
//              z               op_width bits 
//                              Value of exp2(a) - one integer bit and 
//                              op_width-1 fractional bits
//
//  Note: this simulation model runs up to 38 bits in any simulator.
//        It runs for op_width in the range 39-60 only using VCS. There is
//        no simulation model for this range that can be used in other 
//        simulators.
// MODIFIED:
//
//-------------------------------------------------------------------------------

module DW_exp2 (a, z);
parameter op_width=11;              // RANGE 2 to 60 bits
parameter arch=2;                   // RANGE 0 to 2
parameter err_range=1;              // RANGE 1 to 2 ulps

// declaration of inputs and outputs
input  [op_width-1:0] a;
output [op_width-1:0] z;

// synopsys translate_off

  //-------------------------------------------------------------------------
  // Parameter legality check
  //-------------------------------------------------------------------------
  
 
  initial begin : parameter_check
    integer param_err_flg;

    param_err_flg = 0;
    
  
    if ( (op_width < 2) || (op_width > 60) ) begin
      param_err_flg = 1;
      $display(
	"ERROR: %m :\n  Invalid value (%d) for parameter op_width (legal range: 2 to 60)",
	op_width );
    end
  
    if ( (arch < 0) || (arch > 2) ) begin
      param_err_flg = 1;
      $display(
	"ERROR: %m :\n  Invalid value (%d) for parameter arch (legal range: 0 to 2)",
	arch );
    end
  
    if ( (err_range < 1) || (err_range > 2) ) begin
      param_err_flg = 1;
      $display(
	"ERROR: %m :\n  Invalid value (%d) for parameter err_range (legal range: 1 to 2)",
	err_range );
    end
  
    if ( param_err_flg == 1) begin
      $display(
        "%m :\n  Simulation aborted due to invalid parameter value(s)");
      $finish;
    end

  end // parameter_check 


